// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./ClassicPool.sol";

contract PoolFactory {
    address public immutable vault;
    address public feeRecipient;
    address public governance;

    uint24 public defaultSwapFee = 30;
    uint24 public defaultProtocolFee = 5;

    mapping(address => mapping(address => address)) public getPool;
    address[] public allPools;

    event PoolCreated(
        address indexed token0,
        address indexed token1,
        address pool,
        uint256 poolCount
    );
    event FeeUpdated(uint24 swapFee, uint24 protocolFee);

    modifier onlyGovernance() {
        require(msg.sender == governance, "Factory: not governance");
        _;
    }

    constructor(address _vault) {
        require(_vault != address(0), "Factory: zero vault address");
        vault = _vault;
        governance = msg.sender;
        feeRecipient = msg.sender;
    }

    function allPoolsLength() external view returns (uint256) {
        return allPools.length;
    }

    function createPool(
        address tokenA,
        address tokenB
    ) external returns (address pool) {
        require(tokenA != tokenB, "Factory: identical tokens");
        require(tokenA != address(0) && tokenB != address(0), "Factory: zero address");

        (address token0, address token1) = tokenA < tokenB ? (tokenA, tokenB) : (tokenB, tokenA);

        require(getPool[token0][token1] == address(0), "Factory: pool exists");

        ClassicPool newPool = new ClassicPool(
            vault,
            token0,
            token1,
            defaultSwapFee,
            defaultProtocolFee
        );

        pool = address(newPool);

        getPool[token0][token1] = pool;
        getPool[token1][token0] = pool;
        allPools.push(pool);

        emit PoolCreated(token0, token1, pool, allPools.length);
    }

    function createPoolWithFees(
        address tokenA,
        address tokenB,
        uint24 swapFee,
        uint24 protocolFee
    ) external onlyGovernance returns (address pool) {
        require(tokenA != tokenB, "Factory: identical tokens");
        require(tokenA != address(0) && tokenB != address(0), "Factory: zero address");
        require(swapFee <= 1000, "Factory: fee too high");
        require(protocolFee <= 1000, "Factory: protocol fee too high");

        (address token0, address token1) = tokenA < tokenB ? (tokenA, tokenB) : (tokenB, tokenA);

        require(getPool[token0][token1] == address(0), "Factory: pool exists");

        ClassicPool newPool = new ClassicPool(
            vault,
            token0,
            token1,
            swapFee,
            protocolFee
        );

        pool = address(newPool);

        getPool[token0][token1] = pool;
        getPool[token1][token0] = pool;
        allPools.push(pool);

        emit PoolCreated(token0, token1, pool, allPools.length);
    }

    function setDefaultFees(uint24 _swapFee, uint24 _protocolFee) external onlyGovernance {
        require(_swapFee <= 1000, "Factory: swap fee too high");
        require(_protocolFee <= 1000, "Factory: protocol fee too high");

        defaultSwapFee = _swapFee;
        defaultProtocolFee = _protocolFee;

        emit FeeUpdated(_swapFee, _protocolFee);
    }

    function setFeeRecipient(address _feeRecipient) external onlyGovernance {
        require(_feeRecipient != address(0), "Factory: zero address");
        feeRecipient = _feeRecipient;
    }

    function setGovernance(address _governance) external onlyGovernance {
        require(_governance != address(0), "Factory: zero address");
        governance = _governance;
    }
}

contracts/Router.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

interface IVault {
    function deposit(address token, address to, uint256 amount) external payable returns (uint256);
    function withdraw(address token, address to, uint256 amount) external;
    function balanceOf(address token, address owner) external view returns (uint256);
    function internalTransfer(address token, address from, address to, uint256 amount) external;
}

interface IClassicPool {
    function token0() external view returns (address);
    function token1() external view returns (address);
    function swap(address tokenIn, address to, uint8 withdrawMode) external returns (uint256);
    function getAmountOut(address tokenIn, uint256 amountIn) external view returns (uint256);
    function mint(address to) external returns (uint256);
}

interface IPoolFactory {
    function getPool(address tokenA, address tokenB) external view returns (address);
}

contract Router is ReentrancyGuard {
    IVault public immutable vault;
    IPoolFactory public immutable factory;
    address public immutable WETH;

    event SwapExecuted(
        address indexed user,
        address indexed pool,
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 amountOut,
        address to
    );

    event LiquidityAdded(
        address indexed user,
        address indexed pool,
        uint256 amount0,
        uint256 amount1,
        uint256 liquidity
    );

    modifier ensure(uint256 deadline) {
        require(deadline >= block.timestamp, "Router: expired");
        _;
    }

    constructor(address _vault, address _factory, address _weth) {
        require(_vault != address(0), "Router: zero vault");
        require(_factory != address(0), "Router: zero factory");
        require(_weth != address(0), "Router: zero weth");

        vault = IVault(_vault);
        factory = IPoolFactory(_factory);
        WETH = _weth;
    }

    function swapExactTokensForTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external ensure(deadline) nonReentrant returns (uint256[] memory amounts) {
        require(path.length >= 2, "Router: invalid path");
        require(to != address(0), "Router: zero address");

        amounts = new uint256[](path.length);
        amounts[0] = amountIn;

        IERC20(path[0]).transferFrom(msg.sender, address(this), amountIn);
        IERC20(path[0]).approve(address(vault), amountIn);

        vault.deposit(path[0], msg.sender, amountIn);

        for (uint256 i = 0; i < path.length - 1; i++) {
            address pool = factory.getPool(path[i], path[i + 1]);
            require(pool != address(0), "Router: pool not found");

            uint256 amountOut = IClassicPool(pool).swap(
                path[i],
                i == path.length - 2 ? to : msg.sender,
                i == path.length - 2 ? uint8(1) : uint8(0)
            );

            amounts[i + 1] = amountOut;
        }

        require(amounts[amounts.length - 1] >= amountOutMin, "Router: insufficient output");

        emit SwapExecuted(
            msg.sender,
            factory.getPool(path[0], path[1]),
            path[0],
            path[path.length - 1],
            amountIn,
            amounts[amounts.length - 1],
            to
        );

        return amounts;
    }

    function swapExactETHForTokens(
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external payable ensure(deadline) nonReentrant returns (uint256[] memory amounts) {
        require(path.length >= 2, "Router: invalid path");
        require(path[0] == WETH, "Router: invalid path");
        require(to != address(0), "Router: zero address");

        amounts = new uint256[](path.length);
        amounts[0] = msg.value;

        vault.deposit{value: msg.value}(WETH, msg.sender, 0);

        for (uint256 i = 0; i < path.length - 1; i++) {
            address pool = factory.getPool(path[i], path[i + 1]);
            require(pool != address(0), "Router: pool not found");

            uint256 amountOut = IClassicPool(pool).swap(
                path[i],
                i == path.length - 2 ? to : msg.sender,
                i == path.length - 2 ? uint8(1) : uint8(0)
            );

            amounts[i + 1] = amountOut;
        }

        require(amounts[amounts.length - 1] >= amountOutMin, "Router: insufficient output");

        emit SwapExecuted(
            msg.sender,
            factory.getPool(path[0], path[1]),
            path[0],
            path[path.length - 1],
            msg.value,
            amounts[amounts.length - 1],
            to
        );

        return amounts;
    }

    function addLiquidity(
        address tokenA,
        address tokenB,
        uint256 amountADesired,
        uint256 amountBDesired,
        uint256 amountAMin,
        uint256 amountBMin,
        address to,
        uint256 deadline
    )
        external
        ensure(deadline)
        nonReentrant
        returns (uint256 amountA, uint256 amountB, uint256 liquidity)
    {
        address pool = factory.getPool(tokenA, tokenB);
        require(pool != address(0), "Router: pool not found");

        (amountA, amountB) = _calculateOptimalAmounts(
            tokenA,
            tokenB,
            amountADesired,
            amountBDesired,
            amountAMin,
            amountBMin
        );

        IERC20(tokenA).transferFrom(msg.sender, address(this), amountA);
        IERC20(tokenB).transferFrom(msg.sender, address(this), amountB);

        IERC20(tokenA).approve(address(vault), amountA);
        IERC20(tokenB).approve(address(vault), amountB);

        vault.deposit(tokenA, pool, amountA);
        vault.deposit(tokenB, pool, amountB);

        liquidity = IClassicPool(pool).mint(to);

        emit LiquidityAdded(msg.sender, pool, amountA, amountB, liquidity);
    }

    function _calculateOptimalAmounts(
        address tokenA,
        address tokenB,
        uint256 amountADesired,
        uint256 amountBDesired,
        uint256 amountAMin,
        uint256 amountBMin
    ) private view returns (uint256 amountA, uint256 amountB) {
        amountA = amountADesired;
        amountB = amountBDesired;

        require(amountA >= amountAMin, "Router: insufficient A amount");
        require(amountB >= amountBMin, "Router: insufficient B amount");
    }

    function getAmountOut(
        uint256 amountIn,
        address[] calldata path
    ) external view returns (uint256[] memory amounts) {
        require(path.length >= 2, "Router: invalid path");

        amounts = new uint256[](path.length);
        amounts[0] = amountIn;

        for (uint256 i = 0; i < path.length - 1; i++) {
            address pool = factory.getPool(path[i], path[i + 1]);
            require(pool != address(0), "Router: pool not found");

            amounts[i + 1] = IClassicPool(pool).getAmountOut(path[i], amounts[i]);
        }

        return amounts;
    }

    receive() external payable {
        require(msg.sender == WETH, "Router: not WETH");
    }
}

